export default function Professeurs() {
    const [showMore, setShowMore] = useState(false);
    function handleMoreClick() {
        setShowMore(!showMore);
    }
    return (
        <div>    
            {/* <ListeProfesseurs liste={professeurs}/> */}
            <form>
                <label><input type="radio" name="myRadio" value="option1" defaultChecked={true} /> Option 1</label>
                <label><input type="radio" name="myRadio" value="option2" /> Option 2</label>
                <label><input type="radio" name="myRadio" value="option3" /> Option 3</label>
                <button onClick={handleMoreClick}>{showMore ? 'Masquer' : 'Afficher'} les détails</button>
            </form>

            <button onClick={handleMoreClick}>
                {showMore ? 'Masquer' : 'Afficher'} les détails
            </button>
            {showMore && <p>{<ListeProfesseurs liste={professeurs}/>}</p>}
        </div>
    )
}
